import React from 'react';

function Contact() {
    return (
        <div className="contact">
            <h1>Contact me</h1>
            <p>Email: sh577665@dal.ca</p>
            <p>Phone: (782)-882-8904</p>
            <p>LinkedIn: <a href="https://linkedin.com/in/shivaniuppe">https://linkedin.com/in/shivaniuppe</a></p>
        </div>
    );
}

export default Contact;
